// AnesthesiaFirstYear.js
import React from 'react';
import FormComponentAnesthesia from '../../components/FormComponentAnesthesia';

const subjectsData = [
  { subject: 'Paper I - Name of the Subject', paperType: 'Theory', maxMarks: 80, marksSecured: 65 },
  { subject: 'Paper II - Name of the Subject', paperType: 'Theory', maxMarks: 80, marksSecured: 70 },
  { subject: 'Paper III - Name of the Subject', paperType: 'Theory', maxMarks: 40, marksSecured: 35 },
  { subject: 'Practicals', paperType: 'Practical', maxMarks: 120, marksSecured: 100 },
];

const AnesthesiaFirstYear = () => {
  return (
    <FormComponentAnesthesia
      title="First Year B.Sc. Anesthesia Technology Marks Memo"
      subjectsData={subjectsData}
    />
  );
};

export default AnesthesiaFirstYear;
